import Link from 'next/link'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faSignInAlt, faHome, faUser } from '@fortawesome/free-solid-svg-icons';

const Nav = () => (
    <nav className='nav'>
        <ul>
            <li>
                <Link href="/">
                    <a><FontAwesomeIcon icon={ faSignInAlt } /></a>
                </Link>
            </li>
            <li>
                <Link href="/login">
                    <a><FontAwesomeIcon icon={ faHome } /></a>
                </Link>
            </li>
            <li>
                <Link href="/user">
                    <a><FontAwesomeIcon icon={ faUser } /></a>
                </Link>
            </li>
        </ul>
        <style jsx>{`
        ul {
            liststyletype: none;
            margin: 0;
            padding: 0;

        }
        li {
            list-style: none;

        }
        a {
            width: 100%;
            display: flex;
            align-items: center;
        }
        nav {
            background-color: #262F42;
            width: 120px;
        }
        `}</style>
    </nav>
)

export default Nav
